import './App.css';
import RegistrationForm from './Components/Form/Organism/RegistrationForm';

function App() {
  return (
    <section className='m-2 p-2'>
      <div className='bg-light m-3 p-3'>
        <RegistrationForm />
      </div>
    </section>
  );
}

export default App;
